import React from "react";
import { Routes, Route } from "react-router-dom";
import LoginPage from "./pages/auth/login";
import HomePage from "./pages/home";
import PostPage from "./pages/post";
import RegisterPage from "./pages/auth/register";
import HardwarePage from "./pages/hardware";
import SoftwarePage from "./pages/software";
import GamesPages from "./pages/games";
import InnovationsPages from "./pages/innovations";
import AiPages from "./pages/ai";
import FrontEndPage from "./pages/frontendpage";
import BackendPage from "./pages/backendpage";
import NotificationsPage from "./pages/notifications";
import GamesCatPages from "./pages/kategoriOyunlar";
import CategoriesPage from "./pages/categories/inddx";
import CategoriDetailPage from "./pages/categories/detail";
const App = () => {
  return (
    <Routes>
      <Route path="/giris" element={<LoginPage />} />
      <Route path="/gonderi" element={<PostPage />} />
      <Route path="/" element={<HomePage />} />
      <Route path="/kayit" element={<RegisterPage />} />
      <Route path="/bildirimler" element={<NotificationsPage />} />

      <Route path="/kategoriler" element={<CategoriesPage />} />
      <Route path="/kategori/:categoryName" element={<CategoriDetailPage />} />
    </Routes>
  );
};

export default App;
